import React from 'react'

function Header() {
    return (
        <div>
            <div className="nav">
                <ul>
                    <li><a href="">anasayfa</a></li>
                    <li><a href="">iletişim</a></li>
                    <li><a href="">hakkımızda</a></li>
                    <li><a href="">profil</a></li>
                </ul>
            </div>
        </div>
    )
}

export default Header;
